import React, { Component } from 'react';
import './Benchmarks.css'


class Benchmarks extends Component {
    render() {
        const { deadlift, strict_press, clean_and_jerk, backsquat, snatch } = this.props
        return (
            <>
            <figure className="benchmarks-card benchmarks-card--water">
                <div className="benchmarks-card__image-container">
                    <img src="https://cdn.bulbagarden.net/upload/thumb/f/fd/134Vaporeon.png/1200px-134Vaporeon.png" alt="Vaporeon" className="benchmarks-card__image"/>   
                </div>

                <figcaption className="benchmarks-card__caption">
                    <h1 className="benchmarks-card__name">Benchmarks</h1>

                    <h3 className="benchmarks-card__type">
                        1 Rep Max
                    </h3>

                    <table className="benchmarks-card__stats">
                    <tbody><tr>
                        <th>Deadlift</th>
                        <td>{deadlift} KG</td>
                    </tr>
                    <tr>
                        <th>Strict Press</th>
                        <td>{strict_press} KG</td>
                    </tr>

                    <tr>
                        <th>Clean & Jerk</th>
                        <td>{clean_and_jerk} KG</td>
                    </tr>

                    <tr>
                        <th>Backsquat</th>
                        <td>{backsquat} KG</td>
                    </tr>
                    <tr>
                        <th>Snatch</th>
                        <td>{snatch} KG</td>
                    </tr>
                    </tbody></table>

                    <div className="benchmarks-card__abilities">
                    <h4 className="benchmarks-card__ability">
                        <span className="benchmarks-card__label">Update</span>
                        <Button> </Button>
                    </h4>
                    <h4 className="benchmarks-card__ability">
                        <span className="benchmarks-card__label">Hidden Ability</span>
                        Hydration
                    </h4>
                    </div>
                </figcaption>
            </figure>

            </>
        );
    }
}

export default Benchmarks;


